import React, { useState } from 'react';
import { MessageCircle, BarChart3, Package, ShoppingCart, Settings, Menu, X } from 'lucide-react';
import ChatBot from './components/ChatBot';
import Analytics from './components/Analytics';
import Products from './components/Products';
import Orders from './components/Orders';

interface Tab {
  id: string;
  name: string;
  icon: React.ReactNode;
  component: React.ComponentType;
}

const App: React.FC = () => {
  const [activeTab, setActiveTab] = useState('chatbot');
  const [sidebarOpen, setSidebarOpen] = useState(false);

  const tabs: Tab[] = [
    {
      id: 'chatbot',
      name: 'Chat Bot',
      icon: <MessageCircle className="w-5 h-5" />,
      component: ChatBot
    },
    {
      id: 'analytics',
      name: 'Analytics',
      icon: <BarChart3 className="w-5 h-5" />,
      component: Analytics
    },
    {
      id: 'products',
      name: 'Products',
      icon: <Package className="w-5 h-5" />,
      component: Products
    },
    {
      id: 'orders',
      name: 'Orders',
      icon: <ShoppingCart className="w-5 h-5" />,
      component: Orders
    }
  ];

  const ActiveComponent = tabs.find(tab => tab.id === activeTab)?.component || ChatBot;

  return (
    <div className="min-h-screen bg-gray-50">
      {/* Header */}
      <header className="bg-white shadow-sm border-b border-gray-200">
        <div className="px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between items-center h-16">
            <div className="flex items-center">
              <button
                onClick={() => setSidebarOpen(!sidebarOpen)}
                className="lg:hidden p-2 rounded-md text-gray-400 hover:text-gray-500 hover:bg-gray-100"
              >
                {sidebarOpen ? <X className="w-6 h-6" /> : <Menu className="w-6 h-6" />}
              </button>
              <div className="flex items-center ml-4 lg:ml-0">
                <div className="flex-shrink-0">
                  <div className="w-8 h-8 bg-primary-600 rounded-lg flex items-center justify-center">
                    <Package className="w-5 h-5 text-white" />
                  </div>
                </div>
                <div className="ml-3">
                  <h1 className="text-xl font-bold text-gray-900">Ecommerce Dashboard</h1>
                  <p className="text-sm text-gray-500">Professional Management System</p>
                </div>
              </div>
            </div>

            <div className="flex items-center space-x-4">
              <button className="p-2 rounded-md text-gray-400 hover:text-gray-500 hover:bg-gray-100">
                <Settings className="w-5 h-5" />
              </button>
              <div className="flex items-center space-x-3">
                <div className="w-8 h-8 bg-primary-100 rounded-full flex items-center justify-center">
                  <span className="text-primary-600 font-semibold text-sm">AD</span>
                </div>
                <div className="hidden sm:block">
                  <p className="text-sm font-medium text-gray-900">Admin User</p>
                  <p className="text-xs text-gray-500">admin@company.com</p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </header>

      <div className="flex">
        {/* Sidebar */}
        <aside className={`${
          sidebarOpen ? 'translate-x-0' : '-translate-x-full'
        } lg:translate-x-0 fixed lg:static inset-y-0 left-0 z-50 w-64 bg-white shadow-lg border-r border-gray-200 transition-transform duration-300 ease-in-out lg:transition-none`}>
          <div className="flex flex-col h-full pt-16 lg:pt-0">
            <nav className="flex-1 px-4 py-6 space-y-2">
              {tabs.map((tab) => (
                <button
                  key={tab.id}
                  onClick={() => {
                    setActiveTab(tab.id);
                    setSidebarOpen(false);
                  }}
                  className={`w-full flex items-center px-4 py-3 text-sm font-medium rounded-lg transition-colors duration-200 ${
                    activeTab === tab.id
                      ? 'bg-primary-50 text-primary-700 border-primary-200'
                      : 'text-gray-600 hover:text-gray-900 hover:bg-gray-50'
                  }`}
                >
                  <span className="mr-3">{tab.icon}</span>
                  {tab.name}
                </button>
              ))}
            </nav>

            <div className="p-4 border-t border-gray-200">
              <div className="bg-primary-50 rounded-lg p-4">
                <h3 className="text-sm font-semibold text-primary-900 mb-2">Need Help?</h3>
                <p className="text-xs text-primary-700 mb-3">
                  Contact our support team for assistance with your dashboard.
                </p>
                <button className="w-full btn-primary text-xs py-2">
                  Contact Support
                </button>
              </div>
            </div>
          </div>
        </aside>

        {/* Overlay for mobile */}
        {sidebarOpen && (
          <div
            className="lg:hidden fixed inset-0 z-40 bg-black bg-opacity-50"
            onClick={() => setSidebarOpen(false)}
          />
        )}

        {/* Main Content */}
        <main className="flex-1 lg:ml-0">
          <div className="p-6 lg:p-8">
            <div className="max-w-7xl mx-auto">
              {/* Tab Navigation for larger screens */}
              <div className="hidden lg:block mb-8">
                <nav className="flex space-x-8 border-b border-gray-200">
                  {tabs.map((tab) => (
                    <button
                      key={tab.id}
                      onClick={() => setActiveTab(tab.id)}
                      className={`flex items-center py-4 px-1 border-b-2 font-medium text-sm transition-colors duration-200 ${
                        activeTab === tab.id
                          ? 'border-primary-500 text-primary-600'
                          : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
                      }`}
                    >
                      <span className="mr-2">{tab.icon}</span>
                      {tab.name}
                    </button>
                  ))}
                </nav>
              </div>

              {/* Active Tab Content */}
              <div className="animate-fade-in">
                <ActiveComponent />
              </div>
            </div>
          </div>
        </main>
      </div>
    </div>
  );
};

export default App;
